(8, 'Flere jenter knabbet', 'BokoHaram er GÃ†Ã†RNE og knabbet igjen alle jentene de sÃ¥ pÃ¥ vei til BokoHaram mÃ¸te i Bungalowen til venstre.', 'undefined', 2, '2015-04-26 18:53:38'),
(10, 'Nyhet med bvilde', 'Det skkke vÃ¦rra mulig men herh er en nyhet uten bilde.,.....', 'http://d.ibtimes.co.uk/en/full/1418176/nigeria-boko-haram-2000-feared-killed-after-baga-attacked-second-time-days.png', 2, '2015-04-26 19:03:06'),
(11, 'Every landmine in the ground is a threat to civilians', 'The 12th meeting of States Parties to the Convention on the Prohibition of Anti-Personnel Mines took place on 3-7 December 2012 in Geneva. During this event, the ICRC took the opportunity to congratulate States for the progresses, but also to raise some concerns about some lack of implementation of this treaty. It also engaged directly with States, mine clearance organisations and victims. Kathleen Lawand, the head of the Arms Unit at the ICRC, explains the outcome of this conference.', 'http://www.icbl.org/media/195027/History-of-landmines_311x166.jpg', 11, '2015-05-04 13:17:51'),
(12, 'ICRC condemns killing of staff member', 'The International Committee of the Red Cross (ICRC) is profoundly dismayed by the death of one of its staff in Mali. An ICRC aid truck was attacked this morning near Gao, leaving one ICRC staff member dead and a member of the Mali Red Cross injured.', 'https://www.icrc.org/sites/default/files/styles/document_main/public/document/image/mali-news-2.jpg?itok=2fIx2_Ra', 11, '2015-05-04 13:20:08'),
(13, 'Ny kalender funnet', 'Veldig fin denne kalenderen altsÃ¥, og se pÃ¥ den flotte pennen da. Pollen sesong 23 april. Okei da mÃ¥ vi fÃ¥ oss pollenmedisin. Hodet! Hadet! ', 'http://gfx.nrk.no//eBp7UvlYlLIlMRB2hK826QhM4Vec5QGhT2CofbQzq9tw', 3, '2015-05-06 20:43:14');
INSERT INTO `organization` (`organizationNr`, `name`, `category`, `password`, `phone`, `address`, `zipcode`, `logoURL`, `backgroundimgURL`, `website`, `accountnumber`, `email`, `about`, `date_added`) VALUES
(1, 'RÃ¸de Kors', 'HumanitÃ¦rt', '$2a$07$b1R8iJHR0N8aox4wbow5IerEL3L/lYl8C3eAhbfa8ZbNUlnqHsu5W', '', 'BlÃ¥bÃ¦rstien 72', '', 'http://www.ntrk.no/image.php?id=1210&box=150', 'http://www.ifrc.org/PageFiles/88477/110723_Utoya-tragedien_008_main.jpg', 'https://www.rodekors.no/', '', '', 'The International Red Cross and Red Crescent Movement is the largest humanitarian network in the world. Its mission is to alleviate human suffering, protect life and health, and uphold human dignity especially during armed conflicts and other emergencies. It is present in every country and supported by millions of volunteers.  The "Movement" is made up of the following components: the International Committee of the Red Cross, the National Red Cross and Red Crescent Societies and the International Federation of Red Cross and Red Crescent Societies.', '2015-03-17 01:05:29'),
(3, 'UNICEF', 'Barn', 'u', NULL, 'Victoria Terrasse 2134', NULL, 'https://thinkingglobal.wikispaces.com/file/view/UNICEF_Logo.jpg/133230549/259x263/UNICEF_Logo.jpg', 'http://www.supportunicef.org/atf/cf/%7B0DFC909F-14BF-47D2-8E65-B719DFDE2B1C%7D/cardsandgifts.jpg', 'unicef.org', NULL, NULL, 'UNICEF is the driving force that helps build a world where the rights of every child are realized. We have the global authority to influence decision-makers, and the variety of partners at grassroots level to turn the most innovative ideas into reality.  That makes us unique among world organizations, and unique among those working with the young.', '2015-03-29 02:10:31'),
(5, 'Amnesty', 'Menneskerettigheter', 'a', NULL, 'Drobaksundet 282', NULL, 'http://fifcj-ifwlc.com/wp-content/uploads/2015/01/niWJ1nYD.jpeg', 'http://gfx.dagbladet.no/labrador/223/223319/22331919/jpg/active/729x.jpg', 'amnesty.org', NULL, NULL, 'Amnesty International is a global movement of more than 7 million people who take injustice personally. We are campaigning for a world where human rights are enjoyed by all.', '2015-03-29 02:10:31'),
(6, 'Kirkens nÃ¸dhjelp', 'NÃ¸dhjelp', '$2a$07$0XH9hfrF4lfWUXFNorS2GOaRbJGehsFHtxLTVGDQcZAc58U.tTcdy', '123', 'KrAkeveien 89', '0169', 'http://www.nidarosdomen.no/Files/Menigheten/Kirkens%20N%C3%B8dhjelp/_Big/N%C3%B8dhjelp.jpg', 'http://www.innsamling.no/Global/bilder/Aktuelt/Norge/bossebaererutstyr-kit-458.jpg', 'kirkensnodhjelp.no', '', '123', 'In 1947 stretched Norwegian churches out a helping hand to Germany''s civilian victims. Thus was born Church Aid.\r\n\r\nDistress still know no boundaries. We face it with limitless charity.', '2015-03-23 03:34:48'),
(20, 'Plan Norge', 'HumanitÃ¦rt', '$2a$07$CFdhhUgUxcVJxV7IiOsAL.3FjHwmrcGZ8O7sWZFHNsRS2tUA0aDjW', '123', 'Norgesglasset 69', '123', 'http://blogg.fastline.no/wp-content/uploads/2010/08/Media-plan_logo_Bla.ashx_.jpeg', 'http://www.plan-norge.no/sites/default/files/styles/1170x430/public/sponsorproject/defaults/Fadderaksjoner.jpg?itok=5fTwfzmI', '123', '', '123', 'Plan er en global bistandsorganisasjon som driver utviklingsarbeid for A gi barn en bedre framtid. \r\n\r\nVi arbeider i 51 land for A oppfylle barns rett til helsetjenester, skolegang, A fA beskyttelse mot vold og overgrep, og til A delta i beslutninger som pAvirker deres liv. ', '2015-03-23 02:34:59');
