INSERT INTO `project` (`projectID`, `name`, `title`, `about`, `country`, `city`, `logoURL`, `backgroundimgURL`, `organizationNr`, `date_added`) VALUES
(2, 'Raise your hand for girls', 'Rekk opp hAnda de som liker jenter', 'Det var en gang en manns om het magnus og han skrev dette her megafort!', 'Universet', 'Tellus', 'https://pbs.twimg.com/profile_images/532480418839527425/WEKStguk_400x400.jpeg', 'http://cdn.europosters.eu/image/1300/posters/football-girls-i13523.jpg', 5, '2015-03-23 02:35:37'),
(3, 'Vi vil ha mer penger', 'Send more money', '"Canada on Strike" is the fourth episode of the twelfth season of the animated television series South Park,[2] and the 171st episode of the series overall. It first aired on Comedy Central in the United States on April 2, 2008. In the episode, the nation of Canada, feeling disrespected by the rest of the world, goes on a general strike, demanding money, spurring the boys to raise money by creating a viral video.', 'Norge', 'Oslo', 'http://www.marketriders.com/investing/wp-content/uploads/2014/05/Pile-of-Money-copy.jpg', 'http://southparkstudios.mtvnimages.com/images/shows/south-park/clip-thumbnails/season-12/1204/south-park-s12e04c03-im-stephen-abootman-16x9.jpg?', 5, '2015-03-23 03:46:57'),
(9, 'Haiti trenger gryn', 'Fortsatt nOEd', 'Etter jordskjelvet er det det fortsatt folk som trenger vann og greier og greier som koster penger. Kan u ikke bare slenge med noen kroner davel???', 'Haiti', 'Haiti By', NULL, NULL, 1, '2015-03-23 12:21:48'),
(10, 'Hjelp et barn idag!', 'Barnetittel', 'hjelp fattige barn i fattige land! hjelp fattige barn i fattige land! hjelp fattige barn i fattige land!', 'Norge', 'Hamar', NULL, NULL, 3, '2015-04-21 22:57:10'),
(11, 'Mine Action', 'MINE ACTION', 'When a conflict ends, mines and explosive remnants of war like unexploded bombs, shells and cluster-munition bomblets continue to kill and maim. The curse has a name: weapon contamination. It deprives people of water, firewood, farmland, health care and education and it impedes relief work.', 'War', 'mines', 'http://previewcf.turbosquid.com/Preview/Content_2009_09_09__06_40_42/01_ramcek_5.jpg2e33c6cf-e951-40ac-aeac-785e2e429700Larger.jpg', 'https://www.icrc.org/eng/what-we-do/other-activities/mine-action/v-p-lb-e-00671.jpg', 1, '2015-05-04 13:05:03');
